import React, { useEffect, useState } from "react";
import axios from "axios";
import { BsTrash, BsPencilSquare } from "react-icons/bs";
import { InputGroup, FormControl, Button, Modal } from "react-bootstrap";
import "../ToDoList.css";

const TodoList = () => {
  const [toDoList, setToDoList] = useState([]);
  const [newToDo, setNewToDo] = useState("");
  const [showModal, setShowModal] = useState(false);
  const [updatedTitle, setUpdatedTitle] = useState("");
  const [selectedToDoId, setSelectedToDoId] = useState("");

  useEffect(() => {
    fetchToDoList();
  }, []);

  const fetchToDoList = async () => {
    try {
      const response = await axios.get("http://localhost:5000/getToDoList");
      setToDoList(response.data);
    } catch (error) {
      console.error("Error fetching ToDo list:", error);
    }
  };

  const handleAddToDo = async () => {
    try {
      const response = await axios.post("http://localhost:5000/addToDo", {
        title: newToDo,
      });
      setToDoList([...toDoList, response.data]);
      setNewToDo("");
    } catch (error) {
      console.error("Error adding ToDo:", error);
    }
  };

  const handleDeleteToDo = async (id) => {
    try {
      await axios.delete(`http://localhost:5000/deletToDoList/${id}`);
      setToDoList(toDoList.filter((toDo) => toDo._id !== id));
    } catch (error) {
      console.error("Error deleting ToDo:", error);
    }
  };

  const handleUpdateToDo = async () => {
    try {
      const response = await axios.put(
        `http://localhost:5000/updateToDoList/${selectedToDoId}`,
        {
          title: updatedTitle,
        }
      );
      const updatedToDoList = toDoList.map((toDo) =>
        toDo._id === selectedToDoId ? response.data : toDo
      );
      setToDoList(updatedToDoList);
      handleCloseModal();
    } catch (error) {
      console.error("Error updating ToDo:", error);
    }
  };

  const handleOpenModal = (id, currentTitle) => {
    setSelectedToDoId(id);
    setUpdatedTitle(currentTitle);
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setShowModal(false);
  };

  return (
    <div className="todo-container">
      <h1 className="todo-header">ToDo List</h1>
      <InputGroup>
        <FormControl
          placeholder="Add new ToDo"
          value={newToDo}
          onChange={(e) => setNewToDo(e.target.value)}
        />
        <Button variant="primary" onClick={handleAddToDo}>
          Add
        </Button>
      </InputGroup>
      <div className="todo-list">
        {toDoList.map((toDo) => (
          <div key={toDo._id} className="todo-item">
            <h2>{toDo.title}</h2>
            <div className="todo-icons">
              <BsTrash
                className="text-danger cursor-pointer"
                onClick={() => handleDeleteToDo(toDo._id)}
              />
              <BsPencilSquare
                className="text-primary cursor-pointer"
                onClick={() => handleOpenModal(toDo._id, toDo.title)}
              />
            </div>
          </div>
        ))}
      </div>
      <Modal show={showModal} onHide={handleCloseModal}>
        <Modal.Header closeButton>
          <Modal.Title>Update ToDo</Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <FormControl
            placeholder="Enter new title"
            value={updatedTitle}
            onChange={(e) => setUpdatedTitle(e.target.value)}
          />
        </Modal.Body>
        <Modal.Footer>
          <Button variant="secondary" onClick={handleCloseModal}>
            Close
          </Button>
          <Button variant="primary" onClick={handleUpdateToDo}>
            Save Changes
          </Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
};

export default TodoList;
